import React, { useState } from "react";
import axios from "axios";

export default function PostProject() {
  const [formData, setFormData] = useState({
    title: "",
    description: "",
    minBudget: "",
    maxBudget: "",
    deadline: "",
    skills: "",
  });
  const [message, setMessage] = useState("");

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const token = localStorage.getItem("token");
    const clientId = Number(localStorage.getItem("userId"));

    if (!token) return setMessage("You are not logged in!");
    if (!clientId) return setMessage("User ID not found!");

    const projectData = {
      ...formData,
      clientId,
      minBudget: Number(formData.minBudget),
      maxBudget: Number(formData.maxBudget),
      skills: formData.skills.split(",").map((s) => s.trim()),
      deadline: new Date(formData.deadline).toISOString(),
    };

    console.log("Sending project:", projectData);

    try {
      await axios.post("http://localhost:8080/projects", projectData, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setMessage("Project posted successfully!");
      setFormData({ title: "", description: "", minBudget: "", maxBudget: "", deadline: "", skills: "" });
    } catch (error) {
      console.error(error.response?.data || error.message);
      setMessage("Error posting project. Check console for details.");
    }
  };

  return (
    <div style={{
      padding: "40px",
      maxWidth: "500px",
      margin: "50px auto",
      background: "#f9f9f9",
      borderRadius: "12px",
      boxShadow: "0 4px 15px rgba(0,0,0,0.1)",
      fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif"
    }}>
      <h2 style={{ textAlign: "center", marginBottom: "20px", color: "#333" }}>Post a New Project</h2>
      {message && <p style={{ textAlign: "center", color: "#555", marginBottom: "20px" }}>{message}</p>}
      <form onSubmit={handleSubmit} style={{ display: "flex", flexDirection: "column", gap: "15px" }}>
        <input
          type="text"
          name="title"
          placeholder="Project Title"
          value={formData.title}
          onChange={handleChange}
          required
          style={{ padding: "10px", borderRadius: "6px", border: "1px solid #ccc", fontSize: "16px" }}
        />
        <textarea
          name="description"
          placeholder="Project Description"
          value={formData.description}
          onChange={handleChange}
          required
          style={{ padding: "10px", borderRadius: "6px", border: "1px solid #ccc", fontSize: "16px", minHeight: "100px" }}
        />
        <input
          type="number"
          name="minBudget"
          placeholder="Minimum Budget"
          value={formData.minBudget}
          onChange={handleChange}
          required
          style={{ padding: "10px", borderRadius: "6px", border: "1px solid #ccc", fontSize: "16px" }}
        />
        <input
          type="number"
          name="maxBudget"
          placeholder="Maximum Budget"
          value={formData.maxBudget}
          onChange={handleChange}
          required
          style={{ padding: "10px", borderRadius: "6px", border: "1px solid #ccc", fontSize: "16px" }}
        />
        <input
          type="date"
          name="deadline"
          value={formData.deadline}
          onChange={handleChange}
          required
          style={{ padding: "10px", borderRadius: "6px", border: "1px solid #ccc", fontSize: "16px" }}
        />
        <input
          type="text"
          name="skills"
          placeholder="Skills (comma separated)"
          value={formData.skills}
          onChange={handleChange}
          required
          style={{ padding: "10px", borderRadius: "6px", border: "1px solid #ccc", fontSize: "16px" }}
        />
        <button
          type="submit"
          style={{
            padding: "12px",
            borderRadius: "8px",
            border: "none",
            background: "#4CAF50",
            color: "#fff",
            fontSize: "16px",
            cursor: "pointer",
            transition: "background 0.3s"
          }}
          onMouseOver={(e) => e.currentTarget.style.background = "#45a049"}
          onMouseOut={(e) => e.currentTarget.style.background = "#4CAF50"}
        >
          Post Project
        </button>
      </form>
    </div>
  );
}
